import React from "react";
import ReactDOM from "react-dom";
import './index.css'
import Heading from "./Heading";
import Para from "./Para";
import Ul from "./Ul";

function App() {
  return (
    <>
      <Heading />
      <Para />
      <Ul />
      <Para />
    </>
  );
}

export default App;
